// App.js
import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import "./App.css";

function Home() {
  return (
    <div className="home">
      <div className="hero">
        <div className="hero-content">
          <h1>I'm a <span className="highlight">Web Developer</span></h1>
          <p>100% HTML5 React Templates Inspired by Growtech</p>
          <div className="hero-buttons">
            <button>Get Started</button>
            <button>View Portfolio</button>
          </div>
        </div>
        <div className="hero-image">
          <img src="/profile.jpg" alt="Profile" />
        </div>
      </div>
    </div>
  );
}

function About() {
  return <div className="page">About Page</div>;
}
function Services() {
  return <div className="page">Services Page</div>;
}
function Portfolio() {
  return <div className="page">Portfolio Page</div>;
}
function Gallery() {
  return <div className="page">My Work</div>;
}
function Contact() {
  return <div className="page">Contact Page</div>;
}

function App() {
  return (
    <Router>
      <div className="App">
        <nav className="navbar">
          <div className="logo">Growt<span>ech</span></div>
          <ul className="nav-links">
            <li><Link to="/">Home</Link></li>
            <li><Link to="/about">About</Link></li>
            <li><Link to="/services">Services</Link></li>
            <li><Link to="/portfolio">Portfolio</Link></li>
            <li><Link to="/gallery">My Work</Link></li>
            <li><Link to="/contact">Contact</Link></li>
          </ul>
          <div className="resume-buttons">
            <a href="/resumes/resume1.pdf" target="_blank" rel="noreferrer">Resume 1</a>
            <a href="/resumes/resume2.pdf" target="_blank" rel="noreferrer">Resume 2</a>
            <a href="/resumes/resume3.pdf" target="_blank" rel="noreferrer">Resume 3</a>
          </div>
        </nav>

        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/about" element={<About />} />
          <Route path="/services" element={<Services />} />
          <Route path="/portfolio" element={<Portfolio />} />
          <Route path="/gallery" element={<Gallery />} />
          <Route path="/contact" element={<Contact />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
